examples/onefishspecfish.html.body:
One Fish Spec Fish
This is a speculaas implementation of 
One Fish Spec Fish, a blog post by 
Carin Meier. The original version uses clojure.spec.
In a number of occasions where the translation was not straightforward, I have inserted the original
Clojure code as a comment.
const _ = require('lodash');
const s = require('speculaas');

const {isString} = s.utils;

const fishNumbers = {0: 'Zero',
                     1: 'One',
                     2: 'Two'};

// Clojure: (s/def ::fish-number (set (keys fish-numbers)))
s.def('::fish-number', _.keys(fishNumbers).map(_.toInteger));

s.isValid('::fish-number', 1);  // => true
s.isValid('::fish-number', 5);  // => false

s.explain('::fish-number', 5);

s.def('::color', ['Red', 'Blue', 'Dun']);

s.def('::first-line', s.cat(':n1', '::fish-number', ':n2', '::fish-number', 'c1', '::color', 'c2', '::color'));

s.explain('::first-line', [1, 2, 'Red', 'Black']);

api/alt.html.body:
alt
Usage: alt([, ...keyPredForms])
Returns a regex op that returns a map entry containing the key of the
first matching pred and the corresponding value. Thus the
'key' and 'val' functions can be used to refer generically to the
components of the tagged return.
Source
Example:
const s = require('speculaas');
const {isBoolean, isString} = s.utils;

s.def('::bool-or-string', s.alt(':s', isString, ':b', isBoolean));

s.isValid('::bool-or-string', [true]);
// true

s.isValid('::bool-or-string', ['foo']);
// true

s.isValid('::bool-or-string', [1]);
// false

api/amp.html.body:
amp
Usage: amp(re, preds)
Takes a regex op re, and predicates. Returns a regex-op that consumes
input as per re but subjects the resulting value to the
conjunction of the predicates, and any conforming they might perform.
Source
Example:
const s = require('speculaas');
const {isEven, isString} = s.utils;

// Spec for array with even number of strings
s.def('::even-strings', s.amp(s.star(isString), x => isEven(x.length)));

s.isValid('::even-strings', ['a', 1]);
// false

s.isValid('::even-strings', ['a', 'b']);
// true

s.isValid('::even-strings', ['a', 'b', 'c']);
// false

api/and.html.body:
and
Usage: and(...)
Returns a spec that returns the conformed value. Succesive conformed values propagate
through rest of predicates
Source
Example:
const s = require('speculaas');
const {isInteger, isEven} = s.utils;

s.def('::even?', s.and(isInteger, isEven));

s.isValid('::even?', 12);
// true

api/cat.html.body:
cat
Usage: cat(...)
Returns a regex op that matches (all) values in sequence, returning a map
containing the keys of each pred and the corresponding value.
Source
Example:
const s = require('speculaas');
const {isNumber, isString} = s.utils;

s.def('::ingredient', s.cat(':quantity', isNumber, ':unit', isString));
s.conform('::ingredient', [2, ':teaspoon']);
// {':quantity': 2, ':unit': ':teaspoon'}

api/collOf.html.body:
collOf
Usage: collOf(pred[,opts])
Returns a spec for a collection of items satisfying pred. Unlike
'every', collOf will exhaustively conform every value.
Same options as 'every'. conform will produce a collection
corresponding to :into if supplied, else will match the input collection,
avoiding rebuilding when possible.
Source
Example:
const s = require('speculaas');
const {isNumber, isVector} = s.utils;

// spec for vector with 3 unique numbers
s.def('::vnum3', s.collOf(isNumber, {kind: isVector, count: 3, distinct: true}));

s.isValid('::vnum3', [1, 2, 3]);
// true

s.isValid('::vnum3', [1, 2, 2]);
// false

api/conform.html.body:
conform
Usage: conform(spec, x)
Given a spec and a value, returns ':node.spec/invalid' if value does not match spec,
else the (possibly destructured) value.
Source
Example:
const s = require('speculaas');
const {isInteger} = s.utils;

s.def('::a', isInteger);
s.conform('::a', 12);
// 12

api/conformer.html.body:
conformer
Usage: conformer(f, unf)
Takes a predicate function with the semantics of conform i.e. it should return either a
(possibly converted) value or ':node.spec/invalid', and returns a
spec that uses it as a predicate/conformer. Optionally takes a
second fn that does unform of result of first
Source
Example:
const s = require('speculaas');
const {invalidString, isInteger} = s.utils;

const pred = value => isInteger(value) ? value : invalidString;
const spec = s.conformer(pred);

s.isValid(spec, 13);
// true

s.isValid(spec, '13');
// false

api/def.html.body:
def
Usage: def(k, spec)
Given a keyword or resolvable symbol k, and a
spec, spec-name, predicate or regex-op makes an entry in the
registry mapping k to the spec.
Source
Example:
const s = require('speculaas');

// Use a function as spec
s.def('::notZero', x => x !== 0);

s.isValid('::notZero', 42);
// true

// Use an array as spec
const suit = [':club', ':diamond', ':heart', ':spade'];
s.def('::suit', suit);

s.isValid('::suit', ':club'));
// true

api/describe.html.body:
describe
Usage: describe(spec)
Returns an abbreviated description of the spec as data.
Source
Example:
const s = require('speculaas');
const {isNumber, isString} = s.utils;

s.def('::ingredient', s.cat(':quantity', isNumber, ':unit', isString));
s.describe('::ingredient');
// ['cat', ':quantity', 'isNumber', ':unit', 'isString']

api/doubleIn.html.body:
doubleIn
Usage: doubleIn([options])
Specs a 64-bit floating point number. 
Options:

isInfinite
isNaN
min
max

Source
Example:
const s = require('speculaas');
const {isBoolean, isString} = s.utils;

s.def('::percentage', s.doubleIn({min: 0.0, max: 100.0}));

s.isValid('::percentage', 50.1);
// true

s.isValid('::percentage', 101.0);
// false

api/everyKv.html.body:
everyKv
Usage: everyKv(kpred, vpred[, opts])
Like 'every' but takes separate key and val preds and works on associative collections.
