api/instIn.html.body:
instIn
Usage: instIn(start, end)
Returns a spec that validates insts in the range from start
(inclusive) to end (exclusive).
Source
Example:
const s = require('speculaas');

// spec for all dates in 2017
s.def('::2017', s.instIn(new Date('2017'), new Date('2018')));

s.isValid('::2017', new Date('2017-04-27'));
// true

api/intIn.html.body:
intIn
Usage: intIn(start, end)
Returns a spec that validates ints in the range from start (inclusive) to end (exclusive).
Source
Example:
const s = require('speculaas');

// Define range of a single byte
s.def('::oneByte', s.intIn(0, 256));

s.isValid('::oneByte', 0);
// true

s.isValid('::oneByte', 256);
// false

s.isValid('::oneByte', 512);
// false

