api/tuple.html.body:
tuple
Usage: tuple([...preds])
Source
Example:
const s = require('speculaas');
const {isDouble} = s.utils;

s.def('::point', s.tuple(isDouble, isDouble, isDouble));

s.isValid('::point', [1.5, 2.5, -0.5]);
// true

s.isValid('::point', [1.5, 2.5, -0.5, 3.0]);
// false

api/withGen.html.body:
withGen
Usage: withGen(spec, genFn)
Takes a spec and a no-arg, generator-returning fn and returns a version of that spec that uses that generator
Source
Example:
const s = require('speculaas');
const testcheck = require('testcheck');

// Only generate integers in the [5, 7) range
const gen = () => testcheck.gen.intWithin(5, 7);

const spec = s.withGen(s.intIn(0, 10), gen);
